import "./style.css";

function Banner(props) {
  return <div className="banner col-sm-6 col-lg-3 mb-3 ">
    <a href="">
      <div>
        <img className="img-image" src={props.url_image} alt="" />
      </div>
    </a>
  </div>
}

export default Banner;
